<ul>
<li>написать заявку в "Ловит" - <a href="mailto:cc@lovit.ru">cc@lovit.ru</a>;</li>
<li>в течение 5 рабочих дней мастер установит заглушку в щиток, присутствие необязательно при условии свободного доступа к щитку;</li>
<li>иногда акт об отключении мастер кладет в ваш почтовый ящик;</li>
<li>информацию об отключении передается "Ловит" в УК и МособлЕИРЦ;</li>
<li>в следующем расчетном месяце эту строку должны убрать из квитанции.</li>
<p>В случае, если отключение не произошло, то делаете заявку в мобильном приложении "ПИК-Комфорт" в разделе "Нужен перерасчет" и прикладываете скан (фото) акта об отключении.</p>
<p>Если акт об отключении мастер не предоставил, то пишете заявку в "Ловит" на тот же адрес электронной почты и просите подтвердить отключение, скан переписки также прикладываете к заявке на перерасчет.</p>');
<ul>
<li>подняться на этаж выше и зайти в аналогичный отсек;</li>
<li>рядом с такой же квартирой найти два технических ящика, в которых проведены те самые трубы вентиляции, одна - кухня, вторая - ванна;</li>
<li>повернуть рычаг на такой трубе до конца вниз, а затем до конца вверх;</li>
<li>вытяжки должны заработать.</li>
</ul>');
<p>Как их установить на батареи - смотри в этом <a href="https://www.youtube.com/watch?v=OMsIUdebX2g">видео</a>.</p>');
<p>Если вы будете покупать личинку с «вертушкой», то размер 35 внутри и 45 снаружи.</p>');
<ul>
<li>копию акта ввода в эксплуатацию индивидуальных приборов учета (далее - ИПУ), полученного при приемке квартиры, отнести в офис управляющей компании "ПИК-Комфорт" в приемные дни или отправить по электронной почте <a href="mailto:hotline@pik-comfort.ru">hotline@pik-comfort.ru</a> и подождать несколько дней.</li>
</ul>
<p>Если в личном кабинете отражаются не ваши счетчики, необходимо:</p>
<ul>
<li>проверить акт ввода в эксплуатацию ИПУ, выданный при приемке квартиры, на предмет соответствия номеров ИПУ, указанных в этом акте, заводским номерам, указанным на самих ИПУ и в паспортах на ИПУ, выдаваемых менеджерами офиса заселения;</li>
<li>если ошибка в акте ввода в эксплуатацию ИПУ, то необходимо обращаться к менеджеру офиса заселения для выдачи корректного акта, копию которого необходимо отправить по электронной почте <a href="mailto:hotline@pik-comfort.ru">hotline@pik-comfort.ru</a> или отнести в офис управляющей компании "ПИК-Комфорт" в приемные дни;</li>
<li>если в акте ввода в эксплуатацию ИПУ нет ошибки в номерах, но в личном кабинете они отражаются некорректно, то необходимо направить заявку в управляющую компанию "ПИК-Комфорт" (по электронной почте, через чат в приложении, позвонить, лично).</li>
</ul>');
<li>Скачать приложение "ПИК-Комфорт".</li>
<li>Пройти процедуру регистрации по номеру мобильного телефона.</li>
<li>Получить номер лицевого счета можно в чате приложения "ПИК-Комфорт" по соответствующему запросу или посмотреть на бумажной квитанции, которую опускают в ваш почтовый ящик.</li>
<li>После получения номера лицевого счета указать его в приложении, в результате в соответствующем разделе должны отразиться все индвидиуальные приборы учета, установленные в квартире, по которым вы и вносите показания.</li>
</ol>');
<p>В отношении ИПУ установлена их обязательная поверка. Для проведения поверки потребуются именно паспорта на ИПУ, поскольку в них фиксируется вся необходимая информация о дате их установки и периоде эксплуатации. Если документа нет, то провести поверку невозможно, в связи с чем показания установленных в квартире ИПУ могут не приниматься при расчете стоимости услуг ЖКХ.</p>
<ul>
<li>Паспорта на ИПУ выдаются менеджером офиса заселения.</li>
<li>На каждый ИПУ должен быть свой паспорт (на ГВС и ХВС, электричество, на каждую батарею).</li>
<li>В каждом паспорте должны стоять подпись и печать отдела качества предприятия.</li>
<li>В паспорте должен быть указан заводской номер ИПУ, который должен совпадать с номером, указанным в акте ввода в эксплуатацию ИПУ, и с номером непосредственно на ИПУ.</li>
</ul>
<p>Где расположены ИПУ и что делать, если номера не совпадают - читай в отдельной теме этого раздела.</p>');
<ul>
<li>теплоэнергия - на батарее (на каждой батарее отдельный, не путать с терморегулятором);</li>
<li>электричество  - в вашем отсеке в электрощитке (показания Т1 - дневной тариф и Т2 - ночной тариф);</li>
<li>ХВС и ГВС - в вашем отсеке рядом с квартирой в сантехшкафу (ключи для его открытия выдавались при приемке квартиры).</li>');
<ul>
<li>в бумажной квитанции, которую опускают в ваш почтовый ящик;</li>
<li>запросить по адресу своей квартиры в чате личного кабинета "ПИК-Комфорт" в соответствующем приложении для смартфонов. Чат находится в разделе "Заявки".</li>
</ul>
<p>Если вам не открыли лицевой счет, необходимо:</p>
<ul>
<li>копии акта приема-передачи (АПП) и акта ввода в эксплуатацию индивидуальных приборов учета (ИПУ, счетчиков), полученные при приемке квартиры, отнести в офис управляющей компании "ПИК-Комфорт" в приемные дни или отправить по электронной почте <a href="mailto:hotline@pik-сomfort.ru">hotline@pik-сomfort.ru</a>;</li>
<li>подождать 3-4 дня и запросить номер лицевого счета через чат в личном кабинете "ПИК-Комфорт" в соответствующем приложении для смартфонов;</li>
<li>дождаться бумажной квитанции, которую опускают в ваш почтовый ящик в первых числах следующего месяца.</li>
</ul>');
<ol>
<li>Скачать специальное приложение для смартфонов "Домофон".</li>
<li>Зарегистрироваться в приложении по номеру мобильного телефона.</li>
<li>Привязать один из магнитных ключей по номеру, указанному непосредственно на ключе.</li>
<li>Привязка второго магнитного ключа возможна только на уже зарегистрированный телефон.</li>
</ol>
<p>Получение дополнительных магнитных ключей</p>
<ul>
<li>Необходимо обратиться с соответствующей заявкой в управляющую компанию "ПИК-Комфорт", изготовление платное, 500 рублей - один ключ, делают около двух недель, после чего кладут в почтовый ящик. Подробнее на <a href="https://market.pik-comfort.ru/services/domofon/izgotovlenie-kodo-nositelya/">сайте</a> "ПИК-Комфорт".</li>
</ul>');


