INSERT INTO public.faq VALUES (1, '2020-11-29 15:09:50.802581+00', '2020-11-29 15:09:50.802581+00', 1, 'Какая жесткость воды?', '<p>Жесткость воды, установленная с помощью универсального бумажного индикатора, составила 5-6 pH.</p>');
INSERT INTO public.faq VALUES (3, '2020-11-29 17:54:42.940454+00', '2020-11-29 17:54:42.940454+00', 1, 'Какая высота потолков?', '<p>Высота потолков у нас везде разная, так как потолки натяжные, а под ними идут коммуникации. Варьируются от 2,48 м до 2,65 м.</p>');
INSERT INTO public.faq VALUES (4, '2020-11-29 17:55:40.1534+00', '2020-11-29 17:55:40.1534+00', 1, 'Чем отмыть ужасную плитку?', '<p>Ничем. Это такой рисунок. Соседи очень удачно перекрашивают плитку краской.</p>');
INSERT INTO public.faq VALUES (5, '2020-11-29 17:56:13.906497+00', '2020-11-29 17:56:13.906497+00', 1, 'Что делать с заглушками на кухне?', '<p>Возможно два варианта: а) срезать и поставить фитинги под резьбу расширителем; б) через евроконус без расширителя.</p>');
INSERT INTO public.faq VALUES (6, '2020-11-29 17:58:02.759281+00', '2020-11-29 17:58:02.759281+00', 1, 'Как установить терморегулятор на батарею?', '<p>При приемке квартиры менеджерами офиса заселения выдавались терморегуляторы по количеству установленных в квартире батарей.</p>
INSERT INTO public.faq VALUES (7, '2020-11-29 17:59:22.715682+00', '2020-11-29 17:59:22.715682+00', 1, 'Что за квадратное белое с решетками на стене в прихожей?', '<p>Это настенный громкоговоритель (оповещатель) на случай пожарной тревоги. За его самостоятельное отключение или перенос в другое место может быть наложен штраф.</p>');
INSERT INTO public.faq VALUES (8, '2020-11-29 17:59:51.292628+00', '2020-11-29 17:59:51.292628+00', 1, 'Что за квадратное белое на стене кухни?', '<p>Это клеммная коробка для варочной панели (плиты) или духового шкафа.</p>');
INSERT INTO public.faq VALUES (9, '2020-11-29 18:00:39.685902+00', '2020-11-29 18:00:39.685902+00', 1, 'Где взять экспликацию и поэтажный план для оценки банком квартиры?', '<p>Указанные документы можно скачать в личном кабинете на сайте ПИК в разделе "Документы", подраздел "Документы по объекту", обычно файл называется "2---rezultaty-obmerov-bti_20200118_777.pdf".</p>');
INSERT INTO public.faq VALUES (10, '2020-11-29 18:01:12.536945+00', '2020-11-29 18:01:12.536945+00', 1, 'Какой размер личинки двери?', '<p>Размер личинки для наших дверей 35х45 мм, 35 мм со стороны квартиры. Может писаться как 30/10/40 - 10 это ширина "язычка", а если 35/45, то это расстояние до центра отверстия под винт.</p>
INSERT INTO public.faq VALUES (12, '2020-11-29 18:06:08.234332+00', '2020-11-29 18:06:08.234332+00', 2, 'Какой у нас интернет-провайдер?', '<p>Пока единственный провайдер в доме - <a href="https://lovit.ru/">Ловит</a>. В том числе и цифровое телевидение.</p>');
